    </li>
    <li>
    Tiga
    <Image linkGambar='https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/sate.png' />
    </li>
    <li>
    Empat
    <Image linkGambar='https://s3-ap-southeast-1.amazonaws.com/niomic/img/sample/sotolamongan.png' />
    </li>
    </ol>
    </div>
    );
}}export default List;
